gIX(){return"\u2022 Full stack agile development in Java, Flutter, Python, Svelte, and SQL\n\u2022 Designed, developed, and delivered major sections of VisaGO - the first direct-to-consumer facing Visa app with digital issuance and the first to achieve over 150,000 downloads within 90 days\n\u2022 Integrated with ChatGPT on multiple internal projects to speed up other teams\u2019 workflows"},
